import React from 'react';
import './jumbotron.css';
import logo from "../imgs/logo.png"

function Jumbotron() {
  return (
    <div class="full">
      <div class="row justify-content-md-center">
        <div class="col-3 mx-auto" id="logo">
          <img class="img-fluid" src={logo}/>
        </div>
        <div id="title" class="col-12 text-white">
          <div>
            <h2 class="display-4" href="#">Evolution Urban Grows</h2>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Jumbotron;
